meta.script:
window.addEventListener("load", function() {
  setTimeout(function() {
    if (window.location.hash) {
      var element = document.getElementById(window.location.hash.substring(1));
      if (element) {
        element.scrollIntoView();
      }
    }
  }, 100); // 100ms delay
});

